import React from "react";
import styled from "styled-components";
import { StyledNavbar } from "./styledComponents/StyledNavbar";

// type Props = {}
const H1 = styled.h1`
  font-size: 20px;
  font-weight: 600;
`

export const Navbar = (props: any) => {
  return (
    <StyledNavbar>
        <H1>Tomas Sadone</H1>
    </StyledNavbar>
  )
};
